import React from 'react';
import './Hero.css';
import user from '../Assets/user.png';
import home from '../Assets/home.png';
import logo from '../Assets/logo.png';

export const Hero = () => {
  return (
    <div className="hero">
      <div className="hero-left">
        <h2>Welcome to the Collection</h2>
        <p>Style Redefined</p>
        <span>Explore the latest trends now</span>
        <div className="hero-user">
          <img src={user} alt="User" />
          <p>Recommended by Experts</p>
        </div>
        <button className="hero-latest-btn">
          <span>Shop Now</span>
        </button>
      </div>
      <div className="hero-right">
        <img className="hero-logo" src={home} alt="Home" />
      </div>
      <div>
        <img className="hero-logo-extra" src={logo} alt="Logo" />
      </div>
    </div>
  );
};
